import React from 'react';
import Profile from "../components/ProfilePage/Profile"
import Hero from "../components/Hero";
import profileBcg from "../images/Olawale.jpg";
export default function ProfilePage() {
    return (
        <>
            <Hero img="profileBcg">
                <Profile/>
            </Hero>
        </>
    )
}
